import '../styles/ShoppingList.css'
import photo from '../assets/img_kasa.png'

function ShoppingList() {
    return (
        <div className='kasa-shoppinglist'>
            <div>
            <img src={photo} alt='photo paysage' className='kasa-photo' />
            </div>
        </div>
    )
}
export default ShoppingList
